import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the featured products grid (uses ID selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find a product card by its title text (e.g., "Apple iPhone 15 Pro Max")
    // Use text selector for the product title inside .product-title
    const productTitle = 'Apple iPhone 15 Pro Max';
    const productCard = await page.locator('.product-title', { hasText: productTitle }).first();
    await productCard.waitFor({ timeout: 5000 });

    // Click the product card's parent to open the product detail modal
    // Go up to .product-card
    const productCardElement = await productCard.locator('..');
    await productCardElement.click();

    // Wait for the product detail modal to appear (look for .product-detail-title)
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of the product detail modal
    const step2 = path.join(screenshotsDir, 'step_2_product_detail.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the "Add to Wish List" button by its button text
    const wishlistBtn = await page.locator('button', { hasText: 'Add to Wish List' }).first();
    await wishlistBtn.waitFor({ timeout: 5000 });

    // Click the "Add to Wish List" button
    await wishlistBtn.click();

    // Wait for the notification to appear (by .notification.success)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    const step3 = path.join(screenshotsDir, 'step_3_added_to_wishlist.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Close the modal (find the close button by class .close at top right of modal)
    const closeBtn = await page.locator('.modal .close').first();
    await closeBtn.waitFor({ timeout: 5000 });
    await closeBtn.click();

    // Go to the wishlist page
    // Find a link or button with text "Your Wish List" (use text selector)
    const wishlistLink = await page.locator('a', { hasText: 'Your Wish List' }).first();
    await wishlistLink.waitFor({ timeout: 5000 });
    await wishlistLink.click();

    // Wait for the wishlist page to load (look for .wishlist-page)
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });

    // Take screenshot of the wishlist page
    const step4 = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract data: check if the product is present in the wishlist (look for .wishlist-title)
    const wishlistTitles = await page.$$eval('.wishlist-title', els => els.map(e => e.textContent.trim()));
    const foundInWishlist = wishlistTitles.some(title => title.includes('iPhone 15 Pro Max'));

    return {
      success: true,
      action: "Added 'Apple iPhone 15 Pro Max' to wishlist and verified its presence in the wishlist page.",
      extractedData: {
        wishlistTitles,
        foundInWishlist
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
